import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Register from './Resources/register';
import FirstPage from './Resources/starting';
import Account from './Resources/account';
import LogIn from './Resources/Index/LogIn';
import './App.css';
import { setState } from 'react';




class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      authed: false,
    }
  }
  render() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<FirstPage onLoginSuccess={() => this.setState({ authed: true })}/>} />
        <Route path="/register" element={<Register />} />
        <Route path="/account" element={this.props.authed ? <Account /> : <FirstPage />} />
      </Routes>
    </Router>
  );
}
}

export default App;
